description:
Fostering and Me

Sociopolitical Documentary hosted by Lorraine Pascale, published by BBC in 2014 - English narration


Information
------------------------------

To the outside world Lorraine Pascale is the successful TV chef, best-selling author and ex-model, but there is another side to her story. Given up at birth, adopted at 18-months-old and then fostered aged eight when her family broke down, she really has been through the system.
Lorraine looks back at her childhood in a bid to shine a light on the neglected world of fostering and tracks down the foster carers who looked after her as a child, whom she hasn't seen for over 30 years.

